(1, 'Bali Paradise Escape', 'bali-paradise-escape', 'Denpasar', 'Indonesia', 'relaxation', 7, 6, 1, 8, 'Immerse yourself in the beauty of Bali with this all-inclusive package featuring luxury accommodations, cultural experiences, and breathtaking beaches. Discover the island\'s rich culture, visit ancient temples, relax on pristine beaches, and indulge in delicious Balinese cuisine.', '[\"Visit iconic Tanah Lot Temple\", \"Sunrise trek at Mount Batur\", \"Traditional Balinese spa treatments\", \"Ubud cultural immersion\", \"Beach relaxation at Nusa Dua\", \"Rice terrace exploration\"]', '[\r\n    {\r\n      \"day\": 1,\r\n      \"title\": \"Arrival in Bali\",\r\n      \"description\": \"Arrive at Denpasar International Airport and transfer to your luxury resort in Ubud.\",\r\n      \"activities\": [\"Airport pickup\", \"Resort check-in\", \"Welcome dinner\", \"Evening orientation\"]\r\n    },\r\n    {\r\n      \"day\": 2,\r\n      \"title\": \"Ubud Cultural Tour\",\r\n      \"description\": \"Explore the cultural heart of Bali with visits to ancient temples and artisan workshops.\",\r\n      \"activities\": [\"Ubud Palace visit\", \"Sacred Monkey Forest\", \"Traditional art galleries\", \"Local lunch at warung\", \"Silver jewelry workshop\"]\r\n    },\r\n    {\r\n      \"day\": 3,\r\n      \"title\": \"Mount Batur Sunrise Trek\",\r\n      \"description\": \"Early morning trek up Mount Batur to witness a spectacular sunrise over the island.\",\r\n      \"activities\": [\"Pre-dawn pickup (3:30 AM)\", \"Guided trek to summit\", \"Sunrise viewing\", \"Breakfast at summit\", \"Hot springs relaxation\"]\r\n    },\r\n    {\r\n      \"day\": 4,\r\n      \"title\": \"Beach Day at Nusa Dua\",\r\n      \"description\": \"Relax at one of Bali\'s most beautiful beaches with optional water activities.\",\r\n      \"activities\": [\"Transfer to Nusa Dua\", \"Beach relaxation\", \"Snorkeling session\", \"Beachside lunch\", \"Sunset cocktails\"]\r\n    },\r\n    {\r\n      \"day\": 5,\r\n      \"title\": \"Temples and Rice Terraces\",\r\n      \"description\": \"Visit Bali\'s most iconic temples and the stunning Tegallalang Rice Terraces.\",\r\n      \"activities\": [\"Tanah Lot Temple\", \"Tegallalang Rice Terraces\", \"Traditional lunch\", \"Kecak fire dance performance\"]\r\n    },\r\n    {\r\n      \"day\": 6,\r\n      \"title\": \"Spa Day and Shopping\",\r\n      \"description\": \"Indulge in a traditional Balinese spa treatment and browse local markets.\",\r\n      \"activities\": [\"Full body Balinese massage\", \"Flower bath ceremony\", \"Ubud Market shopping\", \"Cooking class\", \"Farewell dinner\"]\r\n    },\r\n    {\r\n      \"day\": 7,\r\n      \"title\": \"Departure Day\",\r\n      \"description\": \"Final day to enjoy resort amenities before departure.\",\r\n      \"activities\": [\"Late checkout\", \"Last-minute shopping\", \"Airport transfer\"]\r\n    }\r\n  ]', '[\"Round-trip airport transfers\", \"6 nights luxury accommodation\", \"Daily breakfast\", \"Welcome and farewell dinners\", \"All guided tours and activities\", \"Entrance fees to attractions\", \"Professional English-speaking guide\", \"Travel insurance\", \"24/7 customer support\"]', '[\"International flights\", \"Personal expenses\", \"Alcoholic beverages (except included meals)\", \"Additional spa treatments\", \"Gratuities for guides and drivers\", \"Visa fees (if applicable)\", \"Travel insurance upgrade\"]', '[\"https://images.unsplash.com/photo-1537996194471-e657df975ab4\", \"https://images.unsplash.com/photo-1552733407-5d5c46c3bb3b\", \"https://images.unsplash.com/photo-1539367628448-4bc5c9d171c8\"]', 1299.00, 899.00, 250.00, '[\"2024-07-15\", \"2024-08-01\", \"2024-08-15\", \"2024-09-01\", \"2024-09-15\", \"2024-10-01\"]', 14, 'Free cancellation up to 14 days before departure. 50% refund for cancellations 7-14 days before. No refund for cancellations within 7 days.', 'easy', 'Moderate walking required for temple visits and rice terrace exploration. Mount Batur trek requires basic fitness level.', 12, 75, 1, 10, 1, 'half-board', 'luxury', 'active', 1, '2025-06-26 02:20:13', '2025-06-26 02:20:13'),
(2, 'Tokyo Cultural Discovery', 'tokyo-cultural-discovery', 'Tokyo', 'Japan', 'cultural', 5, 4, 1, 6, 'Discover the fascinating blend of traditional and modern Japan in Tokyo. Experience ancient temples, cutting-edge technology, delicious cuisine, and vibrant neighborhoods in this comprehensive cultural tour.', '[\"Visit historic Senso-ji Temple\", \"Experience traditional tea ceremony\", \"Explore vibrant Shibuya crossing\", \"Taste authentic sushi at Tsukiji\", \"Discover modern technology in Akihabara\", \"Traditional ryokan experience\"]', '[\r\n    {\r\n      \"day\": 1,\r\n      \"title\": \"Arrival and Asakusa District\",\r\n      \"description\": \"Arrive in Tokyo and explore the traditional Asakusa district.\",\r\n      \"activities\": [\"Airport pickup\", \"Hotel check-in\", \"Senso-ji Temple visit\", \"Nakamise shopping street\", \"Traditional dinner\"]\r\n    },\r\n    {\r\n      \"day\": 2,\r\n      \"title\": \"Imperial Palace and Ginza\",\r\n      \"description\": \"Visit the Imperial Palace gardens and explore upscale Ginza district.\",\r\n      \"activities\": [\"Imperial Palace East Gardens\", \"Traditional tea ceremony\", \"Ginza shopping district\", \"Sushi lunch at Tsukiji\", \"Kabuki theater (optional)\"]\r\n    },\r\n    {\r\n      \"day\": 3,\r\n      \"title\": \"Modern Tokyo - Shibuya and Harajuku\",\r\n      \"description\": \"Experience modern Tokyo culture in trendy neighborhoods.\",\r\n      \"activities\": [\"Shibuya crossing experience\", \"Harajuku fashion district\", \"Meiji Shrine visit\", \"Takeshita Street shopping\", \"Robot restaurant show\"]\r\n    },\r\n    {\r\n      \"day\": 4,\r\n      \"title\": \"Technology and Tradition\",\r\n      \"description\": \"Explore high-tech Akihabara and traditional crafts.\",\r\n      \"activities\": [\"Akihabara electronics district\", \"Traditional craft workshop\", \"Tokyo Skytree visit\", \"Sumida River cruise\", \"Farewell dinner\"]\r\n    },\r\n    {\r\n      \"day\": 5,\r\n      \"title\": \"Departure\",\r\n      \"description\": \"Last-minute shopping and departure.\",\r\n      \"activities\": [\"Free morning\", \"Last-minute shopping\", \"Airport transfer\"]\r\n    }\r\n  ]', '[\"4 nights hotel accommodation\", \"Daily breakfast\", \"Welcome and farewell dinners\", \"All guided tours\", \"Entrance fees\", \"Professional guide\", \"Airport transfers\", \"JR Pass for local transport\"]', '[\"International flights\", \"Lunch and dinner (except mentioned)\", \"Personal expenses\", \"Optional activities\", \"Gratuities\", \"Travel insurance\"]', '[\"https://images.unsplash.com/photo-1540959733332-eab4deabeeaf\", \"https://images.unsplash.com/photo-1513407030348-c983a97b98d8\", \"https://images.unsplash.com/photo-1542051841857-5f90071e7989\"]', 1599.00, 1199.00, 300.00, '[\"2024-06-01\", \"2024-06-15\", \"2024-07-01\", \"2024-07-15\", \"2024-08-01\", \"2024-09-01\"]', 10, 'Free cancellation up to 10 days before departure. 25% refund for cancellations 5-10 days before.', 'easy', 'Extensive walking in urban environment. Good fitness level recommended.', 8, 80, 1, 6, 1, 'breakfast', 'superior', 'active', 1, '2025-06-26 02:20:13', '2025-06-26 02:20:13'),
(3, 'Swiss Alps Adventure', 'swiss-alps-adventure', 'Interlaken', 'Switzerland', 'adventure', 6, 5, 2, 8, 'Experience the breathtaking Swiss Alps with this adventure-packed tour. Enjoy scenic train rides, mountain hiking, paragliding, and charming alpine villages in one of the world\'s most beautiful mountain regions.', '[\"Scenic Jungfraujoch railway\", \"Paragliding over Interlaken\", \"Hiking in pristine alpine trails\", \"Traditional Swiss fondue\", \"Cable car adventures\", \"Crystal-clear mountain lakes\"]', '[\r\n    {\r\n      \"day\": 1,\r\n      \"title\": \"Arrival in Interlaken\",\r\n      \"description\": \"Arrive in the heart of the Swiss Alps and settle into your mountain resort.\",\r\n      \"activities\": [\"Airport/station pickup\", \"Hotel check-in\", \"Interlaken town walk\", \"Welcome dinner with Swiss specialties\"]\r\n    },\r\n    {\r\n      \"day\": 2,\r\n      \"title\": \"Jungfraujoch - Top of Europe\",\r\n      \"description\": \"Take the famous cogwheel train to Jungfraujoch, the highest railway station in Europe.\",\r\n      \"activities\": [\"Early morning train to Jungfraujoch\", \"Ice Palace visit\", \"Sphinx Observatory\", \"Alpine lunch\", \"Afternoon in Grindelwald\"]\r\n    },\r\n    {\r\n      \"day\": 3,\r\n      \"title\": \"Adventure Day - Paragliding and Hiking\",\r\n      \"description\": \"Experience the thrill of paragliding and explore mountain trails.\",\r\n      \"activities\": [\"Paragliding tandem flight\", \"Mountain hiking (3-4 hours)\", \"Alpine picnic lunch\", \"Cable car ride\", \"Evening relaxation\"]\r\n    },\r\n    {\r\n      \"day\": 4,\r\n      \"title\": \"Lake Thun and Spiez\",\r\n      \"description\": \"Explore beautiful Lake Thun and the charming town of Spiez.\",\r\n      \"activities\": [\"Lake Thun boat cruise\", \"Spiez Castle visit\", \"Lakeside lunch\", \"Wine tasting\", \"Traditional Swiss dinner\"]\r\n    },\r\n    {\r\n      \"day\": 5,\r\n      \"title\": \"Lauterbrunnen Valley\",\r\n      \"description\": \"Discover the stunning valley of 72 waterfalls.\",\r\n      \"activities\": [\"Lauterbrunnen valley tour\", \"Trümmelbach Falls\", \"Wengen village visit\", \"Mountain railway rides\", \"Farewell fondue dinner\"]\r\n    },\r\n    {\r\n      \"day\": 6,\r\n      \"title\": \"Departure\",\r\n      \"description\": \"Final morning in the Alps before departure.\",\r\n      \"activities\": [\"Free morning\", \"Last-minute shopping\", \"Airport/station transfer\"]\r\n    }\r\n  ]', '[\"5 nights mountain resort accommodation\", \"Daily breakfast\", \"3 dinners\", \"All train and cable car passes\", \"Paragliding experience\", \"Professional mountain guide\", \"All entrance fees\", \"Airport transfers\"]', '[\"International flights\", \"Lunch (except mentioned)\", \"Personal expenses\", \"Additional adventure activities\", \"Travel insurance\", \"Gratuities\"]', '[\"https://images.unsplash.com/photo-1506905925346-21bda4d32df4\", \"https://images.unsplash.com/photo-1527004760525-b8b6e4b0f7e8\", \"https://images.unsplash.com/photo-1506905925346-21bda4d32df4\"]', 2299.00, 1799.00, 400.00, '[\"2024-06-15\", \"2024-07-01\", \"2024-07-15\", \"2024-08-01\", \"2024-08-15\", \"2024-09-01\"]', 21, 'Free cancellation up to 21 days before departure. 50% refund for cancellations 14-21 days before.', 'moderate', 'Good physical fitness required for hiking and adventure activities. Some activities weather dependent.', 16, 65, 2, 8, 1, 'half-board', 'superior', 'active', 1, '2025-06-26 02:20:13', '2025-06-26 02:20:13'),
(4, 'Paris Romance Getaway', 'paris-romance-getaway', 'Paris', 'France', 'luxury', 4, 3, 2, 4, 'Experience the city of love with this romantic Paris getaway. Enjoy luxury accommodations, fine dining, iconic landmarks, and intimate experiences designed for couples seeking a memorable romantic escape.', '[\"Seine River dinner cruise\", \"Private Eiffel Tower experience\", \"Louvre Museum private tour\", \"Champagne tasting in Montmartre\", \"Luxury spa treatments\", \"Michelin-starred dining\"]', '[\r\n    {\r\n      \"day\": 1,\r\n      \"title\": \"Arrival and Champs-Élysées\",\r\n      \"description\": \"Arrive in Paris and begin your romantic journey.\",\r\n      \"activities\": [\"Airport pickup in luxury vehicle\", \"5-star hotel check-in\", \"Champs-Élysées stroll\", \"Arc de Triomphe visit\", \"Romantic dinner at bistro\"]\r\n    },\r\n    {\r\n      \"day\": 2,\r\n      \"title\": \"Iconic Paris\",\r\n      \"description\": \"Visit Paris\'s most famous landmarks with your loved one.\",\r\n      \"activities\": [\"Private Louvre Museum tour\", \"Tuileries Garden walk\", \"Seine River lunch cruise\", \"Eiffel Tower visit\", \"Dinner at Michelin-starred restaurant\"]\r\n    },\r\n    {\r\n      \"day\": 3,\r\n      \"title\": \"Montmartre and Culture\",\r\n      \"description\": \"Explore artistic Montmartre and enjoy cultural experiences.\",\r\n      \"activities\": [\"Montmartre walking tour\", \"Sacré-Cœur Basilica\", \"Artist square experience\", \"Champagne tasting\", \"Seine dinner cruise with live music\"]\r\n    },\r\n    {\r\n      \"day\": 4,\r\n      \"title\": \"Departure\",\r\n      \"description\": \"Final romantic morning before departure.\",\r\n      \"activities\": [\"Couples spa treatment\", \"Last-minute shopping\", \"Private airport transfer\"]\r\n    }\r\n  ]', '[\"3 nights luxury hotel accommodation\", \"Daily breakfast\", \"2 romantic dinners\", \"Seine River cruise\", \"Private museum tours\", \"Champagne tasting\", \"Couples spa treatmen