--
-- Triggers `reviews`
--
DELIMITER $$
CREATE TRIGGER `update_hotel_rating` AFTER INSERT ON `reviews` FOR EACH ROW BEGIN
    IF NEW.item_type = 'hotel' AND NEW.status = 'approved' THEN
        UPDATE hotels 
        SET user_rating = (
            SELECT AVG(overall_rating) 
            FROM reviews 
            WHERE item_type = 'hotel' 
            AND item_id = NEW.item_id 
            AND status = 'approved'
        )
        WHERE id = NEW.item_id;
    END IF;
END
$$
DELIMITER ;

